import React, { Component } from 'react';
import axios from 'axios'

class Main extends Component {
    state = { 
        data:[]
     }
     componentDidMount() {
         axios.get('https://jsonplaceholder.typicode.com/users')
         .then(response => {
             console.log(response);
             this.setState({
                 data: response.data
             })
         })
     }
    render() { 
        const allData = this.state.data;
        // console.log(allData);
        const checkMap = allData.map((dataCheck, index) => {
            // console.log(index)
            return(
                <div>
                   <div>
                   <table className="table table-striped">
  <thead>
    <tr>
      <th scope="col">#</th>
      <th scope="col">Name</th>
      <th scope="col">UserName</th>
      <th scope="col">Handle</th>
    </tr>
  </thead>
  <tbody>
    <tr>
        <th scope="row">{dataCheck.id}</th>
      <td>{dataCheck.name}</td>
      <td>{dataCheck.username}</td>
      <td>{dataCheck.email}</td>
    </tr>

  </tbody>
</table>
                   </div>
                </div>
            );
        })
        return ( 
            <div>
                {checkMap}
            </div>
         );
    }
}

export default Main;
